import  "./Styles/Road_404.css"
import Table from "./Table";
import RoadContent from "./RoadContent";
import {useRef} from "react";

function Road_404(){

    let tdSize = useRef(0)
    function GetTdSize(getTdSize){
        tdSize.current = getTdSize()
        console.log("size",tdSize.current)
    }
    return(
        <table>
            <Table
                roadConten={RoadContent.content()}
                GetTdSizeAction={GetTdSize}
                tdSize={tdSize} >
            </Table>
        </table>
    )
}
export default Road_404
